y.x:
var $bm_rt;
var k1, kn, dur, t0, tOut, tIn;
if (numKeys > 1) {
    k1 = key(1).time;
    kn = key(numKeys).time;
    dur = $bm_sub(kn, k1);
    t0 = $bm_sub(time, k1);
    tOut = $bm_mod(t0, dur);
    $bm_rt = tIn = $bm_mul($bm_mod(t0, dur), -1);
    if (time < k1) {
        $bm_rt = valueAtTime($bm_sum(tIn, k1));
    } else {
        $bm_rt = valueAtTime($bm_sum(tOut, k1));
    }
} else {
    $bm_rt = value;
}

